  return (    
    <>
    <NavBar />
    <Grid container>
      <Grid item xs={3} bgcolor={"yellow"}>
        <h1>leftbar</h1>
        <div>
          <Home />
        </div>
        <div width>
          <Home />
        </div>
        {/* <LeftBar /> */}
      </Grid>
      <Grid item xs={9} bgcolor={"yellowgreen"}>
        <h1> feed </h1>
      </Grid>
    </Grid>

    </>
  );
};

export default App;
